import React from 'react'
import Profile from '../../components/profile/Profile'
import './home.css'

const Home = () => {
  return (
    <div className="Home">
        <Profile/>
        <div className="postSide">Post</div>
        <div className="rightSide">Right Side</div>
    </div>
  )
}

export default Home
